def global_service_features(machine, field_prefix):
    res = []
    res += list_of_bool_int_fields(machine,
                                   parent_field='{}_global_service_options'.format(field_prefix),
                                   child_fields=global_service_options,
                                   description='global service options.')
    res += enumerated_field(machine,
                            field='{}_refuse_version'.format(field_prefix),
                            enum_list=refuse_versions,
                            version=True)

    machine_errors = {item['key']: item['value']
                      for item in get_field(machine, '{}_refuse_error'.format(field_prefix), t='dict')}

    refuse_errs = ['DESCRIPTION.VSNNUM', 'DESCRIPTION.ERR']
    for err in refuse_errs:
        res += [
            Feature(as_obj={
                '_id': '{}_refuse_err_{}'.format(field_prefix, err),
                '_type': 'MACHINE',
                'expansion_safe': True,
                'value': int(machine_errors[err]) if err in machine_errors else 0,
                'description': 'refuse error {} value?'.format(err)
            })
        ]
    return res


def connect_flag_features(machine, field_prefix):
    res = []
    fields = ['connect_flags0', 'connect_flags1']
    for field in fields:
        res += list_of_bool_int_fields(machine,
                                       parent_field='{}_{}'.format(field_prefix, field),
                                       child_fields=connect_flags,
                                       description='{} flags'.format(field))
    return res


def meta_features(machine, field_prefix):
    res = [
        Feature(as_obj={
            '_id': '{}_SUPPORT'.format(field_prefix),
            '_type': 'MACHINE',
            'expansion_safe': True,
            'value': get_field(machine,
                               '{}_supported'.format(field_prefix),
                               t='int'),
            'description': 'is {} supported?'.format(field_prefix)
        }),
        Feature(as_obj={
            '_id': '{}_DID_RESEND'.format(field_prefix),
            '_type': 'MACHINE',
            'expansion_safe': True,
            'value': get_field(machine,
                               '{}_did_resend'.format(field_prefix),
                               t='int'),
            'description': '{}. True if the server sent a Resend packet '
                           'request in response to the client first '
                           'Connect packet.'.format(field_prefix)
        }),
        Feature(as_obj={
            '_id': '{}_accept_version'.format(field_prefix),
            '_type': 'MACHINE',
            'expansion_safe': True,
            'value': get_field(machine,
                               '{}_accept_version'.format(field_prefix),
                               t='int'),
            'description': '{} The protocol version number '
                           'from the Accept packet ?'.format(field_prefix)
        })
    ]
    return res


def extract(machine, args):
    # todo 'nsn_service_versions' features
    # todo => is there anything valuable in 'redirect_target'
    # todo hex fields refuse_reason_app, refuse_reason_sys
    res = []
    protocol = 'oracle'
    ports = [p for c in ports_and_protocols
             if c[0] == protocol
             for p in c[1]]
    for port in sorted(ports, reverse=True):
        field_prefix = 'p{}_{}_banner'.format(port, protocol)

        res += meta_features(machine, field_prefix)
        res += connect_flag_features(machine, field_prefix)
        res += global_service_features(machine, field_prefix)
        res += tls_f.extract(machine, args,
                             field=field_prefix,
                             _id='p{}_{}'.format(port, protocol))
    return res


